import logo from './logo.svg';
import './App.css';

function App() {
  let i = 0;
  return (
    <div className="App">Hello World>
      <Job salary={9000} position="Senior SDE" company="Amazon" />
      <Job salary={10000} position={"Junior SDE"} company={"Google"} />
    </div>
  );

}

const Job = (props) => {
  return (
      <div>
      <h1>{props.salary}</h1>
      <h1>{props.position}</h1>
      <h1>{props.company}</h1>
      </div>
  );
}
export default App;
